    iterations: 1
    probability: 100
    semantics:
      add: true
      sub: true
      and: true
      xor: true
      or: true
      not: true
      neg: true
    bitwidths:
      bit8: true
      bit16: true
      bit32: true
      bit64: true
  - type: MutationEngine
    iterations: 1
    probability: 100
    extension: SSE
    semantics:
      add: true
      sub: true
      and: true
      xor: true
      or: true
      not: true
      neg: true
    bitwidths:
      bit8: true
      bit16: true
      bit32: true
      bit64: true
  compiler_settings:
    assembler_settings:
      shuffle_basic_blocks: true
      instruction_prefix: ''
      random_prefix_chance: 0.0
    optimization_settings:
      constant_propagation: true
      instruction_combine: true
      dead_code_elim: true
      prune_useless_block_params: true
      iterations: 0
    lifter_settings:
      lift_calls: true
      calling_convention: WindowsAbi
      max_stack_copy_size: 512
      split_on_calls_fallback: true
